  //check\r\n                if (trim(vo.userinput) === '') {\r\n                    return\r\n                }\r\n\r\n                //check\r\n                let r = filter(vo.itemsTrans, (v) => {\r\n                    return isEqual(v, vo.userinput)\r\n                })\r\n                if (size(r) >= 1) {\r\n\r\n                    //$nextTick\r\n                    vo.$nextTick(() => {\r\n\r\n                        //emit\r\n                        vo.$emit('error', 'disable duplicate values')\r\n\r\n                        //clear\r\n                        vo.userinput = ''\r\n\r\n                    })\r\n\r\n                    return\r\n                }\r\n\r\n                //$nextTick\r\n                vo.$nextTick(() => {\r\n\r\n                    //push\r\n                    vo.itemsTrans.push(trim(vo.userinput))\r\n\r\n                    //emit\r\n                    vo.$emit('input', vo.itemsTrans)\r\n\r\n                    //emit\r\n                    vo.$emit('click-add', vo.userinput)\r\n\r\n                    //clear\r\n                    vo.userinput = ''\r\n\r\n                })\r\n\r\n            }\r\n\r\n        },\r\n\r\n        pull: function(ar, kitem) {\r\n            let art = []\r\n            each(ar, (v, k) => {\r\n                if (k !== kitem) {\r\n                    art.push(v)\r\n                }\r\n            })\r\n            return art\r\n        },\r\n\r\n        clickRemoveBtn: function (item, kitem) {\r\n            //console.log('methods clickRemoveBtnPromise', item, kitem)\r\n\r\n            let vo = this\r\n\r\n            //check\r\n            if (vo.enableCloseEventOnly) {\r\n\r\n                //$nextTick\r\n                vo.$nextTick(() => {\r\n\r\n                    //msg\r\n                    let msg = {\r\n                        item,\r\n                        kitem,\r\n                    }\r\n\r\n                    //emit\r\n                    vo.$emit('click-close', msg)\r\n\r\n                })\r\n\r\n                return\r\n            }\r\n\r\n            //$nextTick\r\n            vo.$nextTick(() => {\r\n\r\n                //closeWithInterceptor\r\n                if (vo.closeWithInterceptor) {\r\n\r\n                    //pm\r\n                    let pm = genPm()\r\n\r\n                    //msg, 給予pm使能於外部中止關閉事件\r\n                    let msg = {\r\n                        item,\r\n                        kitem,\r\n                        pm,\r\n                    }\r\n\r\n                    //emit\r\n                    vo.$emit('click-close', msg)\r\n\r\n                    //pm\r\n                    pm\r\n                        .then(() => { //確認關閉\r\n                            //console.log('pm then')\r\n\r\n                            //enableActive and isActive\r\n                            if (vo.enableActive && vo.isActive(item)) {\r\n\r\n                                //emit\r\n                                vo.$emit('update:valueActive', null)\r\n\r\n                            }\r\n\r\n                            //itemsNew\r\n                            let itemsNew = vo.pull(vo.itemsTrans, kitem)\r\n\r\n                            //emit\r\n                            vo.$emit('input', itemsNew)\r\n\r\n                        })\r\n                        .catch((msg) => { //取消關閉\r\n                            //console.log('pm catch', msg)\r\n                        })\r\n\r\n                }\r\n                else {\r\n\r\n                    //msg\r\n                    let msg = {\r\n                        item,\r\n                        kitem,\r\n                    }\r\n\r\n                    //emit\r\n                    vo.$emit('click-close', msg)\r\n\r\n                    //enableActive and isActive\r\n                    if (vo.enableActive && vo.isActive(item)) {\r\n\r\n                        //emit\r\n                        vo.$emit('update:valueActive', null)\r\n\r\n                    }\r\n\r\n                    //itemsNew\r\n                    let itemsNew = vo.pull(vo.itemsTrans, kitem)\r\n\r\n                    //emit\r\n                    vo.$emit('input', itemsNew)\r\n\r\n                }\r\n\r\n            })\r\n\r\n        },\r\n\r\n    },\r\n}\r\n<\/script>\r\n\r\n<style scoped>\r\n.WGroupTags-Trans { /* transition-group必須使用class */\r\n    transition: all 0.5s;\r\n}\r\n</style>\r\n"]},media:void 0})}),mv,"data-v-5ddc2cf2",false,undefined,!1,o,void 0,void 0);var bv={components:{WIconLoading:Mo},props:{pathItems:{type:Array,default:()=>["https://code.highcharts.com/11/highcharts.js","https://code.highcharts.com/11/highcharts-more.js","https://code.highcharts.com/11/modules/stock.js","https://code.highcharts.com/11/modules/annotations.js","https://code.highcharts.com/11/modules/heatmap.js","https://code.highcharts.com/11/modules/boost.js","https://code.highcharts.com/11/modules/boost-canvas.js","https://cdn.jsdelivr.net/npm/w-highcharts/dist/w-highcharts.umd.js"]},options:{type:Object,default:()=>{}},scale:{type:Number,default:3},render:{type:Function,default:null}},data:function(){return{picw:0,pich:0,b64:""}},mounted:function(){Ir(this.pathItems).then((n=>{if("loaded"!==n){let n=window.Highcharts,e=window["w-highcharts"];e.iniMarkers(n),n.setOptions(e.getDefOpt())}}))},watch:{options:{immediate:!0,deep:!0,handler(n){let e=this;e.picw=0,e.pich=0,e.b64="",e.plot()}}},computed:{isEff:function(){return wi(this.options)},isGenDone:function(){return""!==this.b64}},methods:{plot:function(){let n=this;(async function(){if(await mr((()=>void 0!==n.$el)),!n.isEff)return;if(n.isGenDone)return;let e=wt(n,"$el.offsetWidth"),t=wt(n,"$el.offsetHeight");if(!ti(e)||!ti(t))return;if(e<=0||t<=0||n.scale<=0)return;if(!zt(n.render))return void console.log("render is not a function");let r=n.render,o=await r(e,t,n.scale,n.options);n.picw=e,n.pich=t,n.b64=o})().catch((e=>{console.log(e),n.$emit("error",e)}))}}};const Cv=bv;var xv=function(){var n=this,e=n.$c